import React from 'react';
import './AboutUs.css';

const AboutUs = () => (
  <div className="aboutus-container">
    <h2>About Us</h2>
    <p>
      Welcome to Fittr! This app helps you track your calories, plan your meals, and stay on top of your nutrition goals with a sleek, modern interface. Whether you're looking to lose weight, gain muscle, or just eat healthier, Fittr is your companion for a better lifestyle.
    </p>
    <div className="aboutus-team">
      <h3> Team</h3>
      <ul>
        <li>Arya P</li>
        <li>Developer</li>
      </ul>
    </div>
  </div>
);

export default AboutUs;
